import NavBar from './Components/Navbar'

import headerImg from './Assets/home image.jpeg'

import './App.css';

function App() {
  return (
    <div className="App">
      <NavBar></NavBar>
      <div className="Header">
        <div></div>
        <img className="headerImg" src={headerImg} alt="image" /> {/* TODO: make anchor or add onclick? */}
      </div>
    </div>
  );
}

export default App;
